import React from "react";
import styled from "styled-components";

const Signup = styled.form`
  display: flex;
  flex-direction: column;
  width: 50%;
`;

export const Form = () => {
  return (
    <Signup>
      <label>
        Name
        <input />
      </label>
      <label>
        E-mail
        <input />
      </label>
      <label>
        Password
        <input />
      </label>
    </Signup>
  );
};
